import reactDom from 'react-dom';
import CustomModal from './customModal';
import Modal from "react-bootstrap/Modal";

export default function PopupModal(props) {
const {handleNoClick, handleYesClick,setShowModal} = props;


    return (
        <div>
      <Modal bsPrefix = "popupMod" 
        {...props}
      backdrop='static'
      contentClassName="popup-content"
      >

        <Modal.Body bsPrefix = "popupBody" >
          <h1>
              Still reading? 
          </h1>

          <button className="popupYes" onClick={() => handleYesClick()}>
                
          </button>

          <button className = "popupNo" onClick={() => handleNoClick()} > 

          </button>
          
        </Modal.Body>
      </Modal>
      </div>
    );
  }
